import React, { useState } from 'react'
import TodoForm from './components/TodoForm'
function App() {
    const [todos, setTodos] = useState([])
    const addTodos = (todo) => {
        setTodos([...todos, todo])
    }

    return (
        <div>
            <TodoForm addTodos={addTodos} />
        </div>
    )
}

export default App
